import React from "react";

const styles = {
  card: {
    padding: 20,
  },
  projectCard: {
    border: "1px solid black",
  },
};

const Project = () => {
  return (
    <div style={styles.card}>
      <h2>Project</h2>
      <div>Project Name</div>
    </div>
  );
};

export default Project;
